description:
Fast &amp; Furious 4 (2009)


Verenigde Staten
Actie
107 minuten

geregisseerd door Justin Lin
met Vin Diesel, Paul Walker en Michelle Rodriguez

In Los Angeles is Antonio Braga bezig met een grote drugsmisdaad. Undercover politie-agent Brian O'Connor (Paul Walker) werkt aan de zaak om de drugsmisdaad te stoppen. Braga heeft Dominic Toretto (Vin Diesel) onlangs opgelicht tijdens een handel en hij zint op wraak. Dat is de reden dat de twee elkaar opnieuw ontmoeten. Ze zullen elkaar moeten vertrouwen om hun gezamenlijke vijand te stoppen en uit te schakelen. Tijdens wilde auto-achtervolgingen zullen Dominic en Brian alles uit hun race-auto moeten halen om Braga te stoppen.

